import matplotlib.pyplot as plt  

def read_tenth_number_from_file(file_path):  
    tenth_numbers = []  
    
    with open(file_path, 'r') as file:  
        for line in file:  
            numbers = line.split()  
            if len(numbers) >= 15:  
                try:  
                    tenth_number = float(numbers[-10])
                    tenth_numbers.append(tenth_number)  
                except ValueError:  
                    print(f"'{numbers[9]}'")  
    
    return tenth_numbers  

 
file_path = "/mnt/c/Users/qinziwen/Downloads/mon.txt"
tenth_numbers = read_tenth_number_from_file(file_path)  

x_values = range(1, len(tenth_numbers) + 1)  

plt.figure(figsize=(10, 6))
plt.plot(x_values, tenth_numbers, marker='o')  
plt.title('memory')  
plt.xlabel('time')  
plt.ylabel('mem')  
plt.grid()  
plt.savefig('/mnt/c/Users/qinziwen/Downloads/mon.png')